import { configureStore } from "@reduxjs/toolkit";
import { counterReducer } from "./reducers/counter";
import { goodsReducer } from "./reducers/goodsReducer";
export default configureStore({
    reducer: {
        counter: counterReducer,
        goods: goodsReducer,
    },
})
